window.bookSummaryJSON = "<p><b>Paul and his companions are at Becker State Park, preparing to raise the Mansion and restore it to some semblance of flight.</b></p> <p>As they do, a group of supernaturals emerges from the woods, battered and frightened. They’ve been attacked by a madman called \"the Hunter\" who has returned after a long time away. They speak about him with almost mythic intent, treating him like a figure from a dark fairy tale.</p> <p>Little does Paul know that at that moment, the Hunter may prove the demise of himself, his supernatural companions, and the House of the Talismancer.</p> <p>The Protecting Supernaturals series contains unconventional relationships.</p>"; 
